  input: TEXT,F3XA,,"BUILD PAC is committed to properly disclosing all information
    in a precise and timely manner.  To adhere to that commitment, this amended report
    is a response to a letter dated February 15, 2002 from Antoinette Kitchen, FEC
    Reports Analysis Division. Bank of America and American Express charge fees for
    processing contributions that are made by credit card.  These fees were incorrectly
    disclosed on Line (21)(a)(ii). Federal and local taxes paid to the Internal Revenue
    Service and the District of Columbia Office of Tax Revenue were also incorrectly
    disclosed on Line 21(a).  At the direction of Ms. Kitchen on February 22, 2002,
    the payments for the bank fees and taxes are being moved to line 21(b) to accurately
    reflect the nature of these expenses."
